import posts from './../../data/posts';

export default function Tag() {
	let newArr;
	newArr = posts.tag.map((val, idx) => val.split(','));

console.log(newArr)

	let removeDuplicate = () => {
		let duplicates = Array.prototype.reduce((acc, el, i, arr) => {
			if(arr.indexOf(el) !== i && acc.indexOf(el) < 0) {
				acc.push(el);
			}
			return acc;
		},[]);
		return duplicates;
	}

	return (
		<>
	    <h3 className="sidebar-title">Tags</h3>
	    <div className="sidebar-item tags">
	      <ul>
	      {/*
